import React from 'react'

//styles
import "./recipeList.css"


export default function RecipeList({recipes}) {
  return (
    <div className='recipe-list'>
      RecipeList
      {recipes.map((recipe) => (
        <div key={recipe.id} className='card'>
            <h3>{recipe.title}</h3>
            <p>{recipe.cookingTime}</p>
            <div>{recipe.method.substring()}</div>
        </div>
      ))}
    </div>
  )
}
